func calcString(a []byte) int {
	c := 0

	for i := range a {
		switch {
		case a[i] == '"':
			c += 2 // => \"
		case a[i] == '\\':
			c += 2 // => \\
		case a[i] == '\n':
			c += 2 // => \n
		case a[i] == '\t':
			c += 2 // => \t
		case a[i] == '\r':
			c += 2 // => \r
		case a[i] < 32:
			c += 6 // => \u00XX
		default:
			c += 1
		}
	}

	return c
}


func string2ByteSlice(a string) []byte {
	stringHead := (*struct {
		Data uintptr
		Len  int
	})(unsafe.Pointer(&a))
	sliceHead := &struct {
		Data uintptr
		Len  int
		Cap  int
	}{
		Data: stringHead.Data,
		Len:  stringHead.Len,
		Cap:  stringHead.Len,
	}
	return *(*[]byte)(unsafe.Pointer(sliceHead))
}

func escapeStr(w io.Writer, input string) {
    stringHead := (*struct {
		Data uintptr
		Len  int
	})(unsafe.Pointer(&input))
	sliceHead := &struct {
		Data uintptr
		Len  int
		Cap  int
	}{
		Data: stringHead.Data,
		Len:  stringHead.Len,
		Cap:  stringHead.Len,
	}
	a := *(*[]byte)(unsafe.Pointer(sliceHead))
	
for i := range a {
		switch {
		case a[i] == '"':
			// => \"
            w.Write(json_double_quote)
		case a[i] == '\\':
			// => \\
            w.Write(json_backslash)
		case a[i] == '\n':
			// => \n
            w.Write(json_newline)
		case a[i] == '\t':
			// => \t
            w.Write(json_tab)
		case a[i] == '\r':
			// => \r
            w.Write(json_return)
		case a[i] < 32:
			// => \u00XX
			w.Write(jsonUnicodeEscapeChar[a[i]])
		default:
            w.Write([]byte{a[i]})
		}
	}

}

func writeStr(w io.Writer, a string) {
	stringHead := (*struct {
		Data uintptr
		Len  int
	})(unsafe.Pointer(&a))
	sliceHead := &struct {
		Data uintptr
		Len  int
		Cap  int
	}{
		Data: stringHead.Data,
		Len:  stringHead.Len,
		Cap:  stringHead.Len,
	}
	w.Write(*(*[]byte)(unsafe.Pointer(sliceHead)))
}

